import React from 'react'

const Grid = () => {

  return (
    <table class="table">
      <thead class="thead-dark">
        <tr>
          <th scope="col">Month</th>
          <th scope="col">Time In</th>
          <th scope="col">Time Out</th>
          <th scope="col">Hours</th>
          <th scope="col">Notes</th>
        </tr>
      </thead>
      <tbody>
        {Array.from(Array(10).keys()).map((item, cell) => {
          return (
            <tr key={item}>
              <th scope="row">2</th>
              <td>Jacob</td>
              <td>Thornton</td>
              <td>@fat</td>
              <td>note</td>
            </tr>
          )
        })}
      </tbody>



    </table>

  )
}

export default Grid
